function request(url) {
  return fetch(
    'https://proxy-q-doctor.herokuapp.com/api/emias/'+url,
    {
      method: 'GET',
      headers: {'Content-Type': 'application/json'},
    },
  );
}


const getDepartments = (omsNumber, birthDate) => request(`departments?omsNumber=${omsNumber}&birthDate=${birthDate}`);
const getDoctors = (omsNumber, birthDate, specialityId) => request(`doctors/${specialityId}?omsNumber=${omsNumber}&birthDate=${birthDate}`);
const getSchedule = (lpuId) => request(`schedule/${lpuId}`);

export { getDepartments, getDoctors, getSchedule };
